public boolean hasNext() throws IOException {
  while (next == null && iter.hasNext()) {
    LocatedFileStatus unfilteredNext = iter.next();
    if (!isChecksumFile(unfilteredNext.getPath())) {
      next = unfilteredNext;
    }
  }
  return next != null;
}
